import React, { useEffect, useState } from 'react';
import axios from 'axios';

const planDisplayNames = {
  starter: 'Starter',
  premium: 'Premium',
  pro: 'Pro',
};

const mockCurrent = {
  plan: 'Pro',
  status: 'active',
  expiresAt: new Date(Date.now() + 8 * 24 * 60 * 60 * 1000),
  rejectionReason: '',
};
const mockHistory = [
  { plan: 'Basic', status: 'expired', expiresAt: new Date(Date.now() - 20 * 24 * 60 * 60 * 1000), rejectionReason: '' },
  { plan: 'Pro', status: 'rejected', expiresAt: new Date(Date.now() - 40 * 24 * 60 * 60 * 1000), rejectionReason: 'Payment failed' },
];

const Subscription = () => {
  const [subscriptions, setSubscriptions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchSubscriptions = async () => {
      setLoading(true);
      setError('');
      try {
        const token = localStorage.getItem('token');
        const res = await axios.get('/api/auth/user-subscriptions', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setSubscriptions(res.data.subscriptions);
      } catch (err) {
        setError('Could not fetch subscriptions.');
      }
      setLoading(false);
    };
    fetchSubscriptions();
  }, []);

  const daysLeft = Math.ceil((mockCurrent.expiresAt - Date.now()) / (1000 * 60 * 60 * 24));

  return (
    <div style={{ maxWidth: 600, margin: '0 auto', color: '#E5E7EB' }}>
      <h2 style={{ color: '#2ECC71', fontWeight: 700, fontSize: '1.7rem', marginBottom: '1.2rem' }}>My Subscription</h2>
      <div style={{ background: '#23272F', borderRadius: '1rem', padding: '2rem', marginBottom: '2rem', boxShadow: '0 2px 12px rgba(0,0,0,0.08)' }}>
        <div style={{ marginBottom: '1rem' }}><b>Current Plan:</b> {mockCurrent.plan}</div>
        <div style={{ marginBottom: '1rem' }}><b>Status:</b> {mockCurrent.status}</div>
        <div style={{ marginBottom: '1rem' }}><b>Expires At:</b> {mockCurrent.expiresAt.toLocaleDateString()}</div>
        {mockCurrent.status === 'rejected' && (
          <div style={{ color: '#FF6B35', marginBottom: '1rem' }}><b>Rejection Reason:</b> {mockCurrent.rejectionReason}</div>
        )}
        {daysLeft <= 10 && mockCurrent.status === 'active' && (
          <div style={{ color: '#FF6B35', marginBottom: '1rem', fontWeight: 600 }}>Your plan expires in {daysLeft} days. <button style={{ background: '#2ECC71', color: '#181A20', border: 'none', borderRadius: '0.5rem', padding: '0.5rem 1.2rem', fontWeight: 700, fontSize: '1rem', cursor: 'pointer', marginLeft: '0.7rem' }}>Upgrade</button></div>
        )}
      </div>
      <h3 style={{ color: '#2ECC71', fontWeight: 600, marginBottom: '1rem' }}>Subscription History</h3>
      {mockHistory.map((h, i) => (
        <div key={i} style={{ background: '#23272F', borderRadius: '1rem', padding: '1.2rem', marginBottom: '1rem', boxShadow: '0 1px 6px rgba(0,0,0,0.07)' }}>
          <div><b>Plan:</b> {h.plan}</div>
          <div><b>Status:</b> {h.status}</div>
          <div><b>Expires At:</b> {h.expiresAt.toLocaleDateString()}</div>
          {h.status === 'rejected' && <div style={{ color: '#FF6B35' }}><b>Rejection Reason:</b> {h.rejectionReason}</div>}
        </div>
      ))}
    </div>
  );
};

export default Subscription;
